package javapackage;

public class Do_while {

	 public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 1;
		// do while loop
		do {
			System.out.println(i);
		i++;		
		} while (i>4);
			

	int a =5;
	 do {
		 System.out.println(a);
		 a++;
		 
	 }
	 while (a >10 );
	 
	}

}
